import React from "react";
import PlayerCard from "./PlayerCard";
import ButtonToPlay from "./ButtonToPlay";
import ButtonToSelect from "./ButtonToSelect";
import "./App.css";
const App = () => {
  return (
    <div className="main-container">
      <div className="main-container__players clearfix">
        <PlayerCard />
        <PlayerCard />
      </div>
      <div className="main-container__buttons">
        <ButtonToSelect />
        <ButtonToSet />
        <ButtonToSet />
        <ButtonToPlay />
        <ButtonToPlay />
      </div>
    </div>
  );
};

export default App;
